INSERT INTO `movie` (`id`, `titulo`, `duracion`, `director`, `genero`, `sinopsis`, `estreno`, `valoracion`, `caratula`, `user_id`) VALUES
	(1, 'Shine a Light', 122, 'Martin Scorsese', 'Documental', 'Documental sobre los Rolling Stones. Un acercamiento riguroso, deslumbrante, divertido y profundamente humano al pasado y al presente de los cuatro miembros de la banda. Excelente equipo técnico en el que destacan los directores de fotografía Robert Richarson (Aviador, JFK), Mitch Amundsen (Misión Imposible 3), Stuart Dryburgh (El Piano), Robert Elswit (Buenas Noches, Buena Suerte), Ellen Kuras (Olvídate de Mí), Andrew Lesnie (EL Señor de los Anillos), Emmanuel Lubezki (Sleepy Hollow), Anastas Michos (Quiz Show), Declan Quinn (Leaving Las Vegas), John Toll (Braveheart) y Albert Mayles, director de GIMME SHELTER, documental sobre los trágicos eventos ocurridos en San Francisco en 1969 durante el concierto más multitudinario de los ROLLING STONES -información de la distribuidora-. (FILMAFFINITY)', 2008, 4, '618a95d65669f.jpg', 25),
	(2, 'Rocketman', 121, 'Dexter Fletcher', 'BioPic', '\'Rocketman\' es la historia de Elton John, desde sus años como niño prodigio del piano en la Royal Academy of Music hasta llegar a ser una superestrella de fama mundial gracias a su influyente y duradera asociación con su colaborador y letrista Bernie Taupin. (FILMAFFINITY)', 2019, 3, '618a94dfcf3e3.jpg', 25),
	(3, 'Bohemian Rhapsody', 134, 'Bryan Singer', 'BioPic', '\'Bohemian Rhapsody\' es una celebración del grupo Queen, de su música y de su singular cantante Freddie Mercury, que desafió estereotipos para convertirse en uno de los showmans más queridos del mundo. El film plasma el meteórico ascenso de la banda al olimpo de la música a través de sus icónicas canciones y su revolucionario sonido, su crisis cuando el estilo de vida de Mercury estuvo fuera de control, y su triunfal reunión en la víspera del Live Aid, en la que Mercury, mientras sufría una enfermedad que amenazaba su vida, lidera a la banda en uno de los conciertos de rock más grandes de la historia. Refleja asimismo cómo se cimentó el legado de una banda que siempre se pareció más a una familia, y que continúa inspirando soñadores y amantes de la música hasta nuestros días. (FILMAFFINITY)', 2018, 4, '618a94ff0d365.jpg', NULL),
	(4, 'The Song Remains the Same', 137, 'Peter Clifton & Joe Massot', 'Concierto', 'Concierto de Led Zeppelin, filmado en el Madison Square Garden durante su gira de 1973. (FILMAFFINITY)', 1976, 4, '619d19cc64ae6.jpg', 9),
	(5, 'The Last Waltz', 117, 'Martin Scorsese', 'Documental', 'Documental sobre el mundo del rock rodado en 1976 en el que Scorsese filma los conciertos de despedida de "The Band", por los que pasaron Bob Dylan, Van Morrison, Neil Young, Joni Mitchell, Neil Diamond, Eric Clapton y otras míticas figuras del rock de las últimas décadas. (FILMAFFINITY)', 1978, 4, '618a95392b080.jpg', NULL),
	(6, 'The Dirt', 107, 'Jeff Tremaine', 'BioPic', 'Basada en la autobiografía publicada por el grupo Mötley Crüe en 2001, esta obra refleja la historia de fama, sexo, drogas y rock \'n roll, así como el precio del exceso que tuvieron que pagar sus miembros. (FILMAFFINITY)', 2019, 2, '6197c00871f58.jpg', 25),
	(7, 'The Great Rock & Roll Swindle', 103, 'Julien Temple', 'BioPic', 'Biografía ficticia sobre los Sex Pistols (John Lydon, Sid Vicious, Paul Cook y Steve Jones). Su mánager Malcolm McLaren divulga, de modo maquiavélico, que la creación de la banda no era más que parte de un gran plan para engañar a las compañías de discos y agitar a la juventud indolente de todo el mundo. (FILMAFFINITY)', 1980, 3, '618a955c2740e.jpg', 9),
	(8, 'No Direction Home', 208, 'Martin Scorsese', 'Documental', 'Extraordinaria historia del viaje de Bob Dylan desde sus raíces en Minnesota hasta la época de sus comienzos en los cafés del Greenwich Village, pasando por su sonada ascensión al estrellato del pop en 1966. Joan Baez, Allen Ginsberg y otros comparten sus pensamientos y sentimientos sobre el joven cantante que cambiaría para siempre la música popular. Incluye entrevistas exclusivas y, además, secuencias y actuaciones inéditas. (FILMAFFINITY)', 2005, 2, '618a95691cda1.jpg', 25),
	(9, 'LennonNYC', 115, 'Michael Epstein', 'Documental', 'Documental que sigue la vida de John Lennon en Nueva York durante los años 70. Los últimos años de Lennon. "Lennonyc reconstruye la emigración voluntaria del ex-Beatle a la Gran Manzana, su escape de una Inglaterra que parecía haber dejado de quererle (y cuyos periódicos no cesaban de llamar "fea" a Yoko) para reinventarse como new yorker. Y, a la sazón, en este periodo quizás se unen el Lennon más feliz y el más desdichado. Con un genial despliegue de archivo, múltiples entrevistas con Lennon, declaraciones de todos los figurantes y extras de aquellos años (el fotógrafo Bob Gruen, los miembros de la Elephant\'s Memory band, productores, músicos) y, muy especialmente, las declaraciones actuales de Yoko Ono, Lennonyc reconstruye mes a mes, día a día, la vida neoyorquina de Lennon: su politización Yippie de los primeros años (y el irregular álbum de la Plastic Ono Band en que ésta se materializó), su "fin de semana perdido" en L.A., cuando Ono le echó de casa -ver documental de Nilsson en este In-Edit para más señas alcoholizadas-, la grabación angelina (y borrachuza) del disco Rock and roll con Phil Spector, los constantes intentos del FBI de deportarle de vuelta al Reino Unido, su vida familiar (nacimiento de su hijo Sean) y, cómo no, La Pasión de Lennon, su injusta, arbitraria y trágica muerte." (sinopsis extraída de in-edit). (FILMAFFINITY)', 1976, 4, '6197be8725558.jpg', 9),
	(10, 'Some Kind of Monster', 141, 'Joe Berlinger & Bruce Sinofsky', 'Documental', 'Documental sobre una de las mejores bandas de rock de los últimos tiempos. Se sumerge dentro del estudio de grabación y de las mentes de Metallica, según van grabando su álbum ganador del Grammy “St. Anger”, al tiempo que se enfrentan a altibajos en su comunicación, adicciones, la deserción de un miembro del grupo, paternidad, caos familiar y su casi total desintegración durante la época más turbulenta de sus veinte años de historia. (FILMAFFINITY)', 2004, 3, '618aa14da9dad.jpg', NULL),
	(73, 'Kurt Cobain: Montage of Heck', 132, 'Brett Morgen', 'Documental', 'El documental autorizado del malogrado músico Kurt Cobain, desde su primera época en Aberdeen Washington hasta su éxito con la banda grunge Nirvana. (FILMAFFINITY)', 2015, 4, '6197c18574069.jpg', 25),
	(74, 'Janis', 115, 'Amy Berg', 'Documental', 'Documental sobre la legendaria cantante estadounidense Janis Joplin (1943-1970). La artista Cat Power, cantante de rock de origen sureño, narra en primer persona cómo Janis Joplin llegó a convertirse en una estrella, a través de las cartas que Joplin escribió durante años a sus familiares, amigos y colaboradores, antes de su fatídica muerte a los 27 años. (FILMAFFINITY)', 2015, 4, '6197c1e96a87e.jpg', 9),
	(75, 'How the Beatles Changed the World', 110, 'Tom O\'Dell', 'Documental', 'La fascinante historia de la revolución cultural, social, espiritual y musical aparecida tras la llegada de los Beatles. El documental aborda el impacto que los cuatro miembros del grupo tuvieron, desde su primer impacto en Liverpool hasta su llegada a los Estados Unidos y su expansión por todo el mundo. De cómo unos subversivos jóvenes de clase media pasaron a convertirse en todo unos héroes contraculturales para toda una generación. Una nueva toma a la que quizás haya sido el grupo más importante en la historia de la música, cuyo impacto en la cultura popular parece imborrable.', 2017, 4, '6197c2455982f.jpg', 25),
	(76, 'This Is It', 111, 'Kenny Ortega', 'Documental', 'Película documental realizado con el material grabado durante los últimos ensayos del "rey del pop" Michael Jackson (29 de agosto de 1958-25 junio de 2009), que preparaba su regreso a los escenarios cuando murió por consumo de pastillas, en circustancias todavía no del todo claras. La mayor parte del montaje del film fue rodado en junio de 2009 en el Staples Center de Los Ángeles y The Forum en Inglewood, en California, cuando Michael preparaba su \'This is it\', la serie de 50 conciertos que iba a ofrecer en el O2 Arena de Londres. Dirige el documental Kenny Ortega, responsable de los "High School Musical". (FILMAFFINITY)', 2009, 3, '6197c318a09a9.jpg', NULL),
	(77, 'Dover: Die for Rock & Roll', 120, 'Miguel L. Garrido', NULL, '', 2022, 1, '619d15c230278.jpg', 25),
	(78, 'Reclaiming Amy', 59, 'Marina Parker', 'Documental', 'Con motivo del décimo aniversario de la muerte de Amy Winehouse, los padres Janis y Mitch, y sus amigos y familiares más cercanos, comparten la historia del ícono de la música británica', 2021, 1, '619d162583aea.jpg', 25),
	(79, 'Blackpink: The Show', 87, 'YG Entertainment', 'Documental', '', 2021, 3, '619d1693d883d.jpg', 25),
	(80, '1971: El año en el que la música lo cambió todo', 45, 'Asif Kapadia, Danielle Peck, James Rogan', 'Documental', 'Serie de TV (2021). 8 episodios. En una época tumultuosa, 1971 fue un año de innovación musical y renacimiento impulsado por la agitación política y cultural de la época. Las estrellas alcanzaron nuevas alturas, nuevos talentos irrumpieron en escena y los límites se expandieron como nunca antes. La serie documental brindará una mirada más cercana hacia los artistas y canciones más icónicos que todavía escuchamos 50 años después, incluidos The Rolling Stones, Aretha Franklin, Bob Marley, Marvin Gaye, The Who, Joni Mitchell, Lou Reed y más', 2021, 4, '619d16c0ed091.jpg', 25),
	(81, 'Jagged', 97, 'Alison Klayman', 'Documental', 'Documental sobre la vida y obra de la cantante Alanis Morissette, ganadora de 7 Premios Grammy y que se hizo mundialmente conocida en 1995 con su disco "Jagged Little Pill".', 2021, 4, '619d17103c918.jpg', 25),
	(82, 'Joe Bonamassa: Now Serving Royal Tea Live From The Ryman', 95, 'Joe Bonamassa', 'Documental', 'El año pasado, cuando el COVID-19 detuvo la industria de las giras en vivo, el héroe de la guitarra Joe Bonamassa hizo algo sin precedentes para sus fanáticos, organizó un espectáculo de una sola noche en el icónico Auditorio Ryman en Nashville, TN para ser transmitido en vivo para los fanáticos de todo el mundo. Esa noche reunió a personas de 44 países de todo el mundo para una presentación fenomenal de música en vivo de su nuevo álbum "Royal Tea" antes incluso de su lanzamiento.', 2021, 3, '619d173cc520a.jpg', 25),
	(83, 'Bob Dylan: Odds and Ends', 111, 'Jennifer Lebeau, John Hillcoat', 'Documental', 'Algunos de los momentos más importantes en la carrera del legendario músico, compositor, cantante y poeta estadounidense Bob Dylan a través de entrevistas, vídeos y cortometrajes de archivo.', 2021, 4, '619d1780b1d46.jpg', 25),
	(84, 'KISStory', 173, 'D.J. Viola', 'Documental', 'Documental sobre la banda neoyorkina KISS. Contada desde la perspectiva de los cofundadores Gene Simmons (bajo) y Paul Stanley (guitarra rítmica), sin la aprobación de los exmiembros fundadores Ace Frehley (guitarra principal) y Peter Criss (batería).', 2021, 2, '619d17c58f70c.jpg', 25),
	(85, 'Woodstock 99: Peace Love and Rage', 110, 'Garret Price', 'Documental', 'Woodstock 99, un festival de música de tres días con la intención de hacer eco de la unidad y del idealismo contracultural del concierto original de 1969 que, en su lugar, cae en revueltas, saqueos y abusos sexuales.', 2021, 4, '619d18162e32c.jpg', 25),
	(86, 'Blackpink: The Movie', 100, 'Oh Yoon-dong, Jung Su-yee', 'Documental', 'Película documental sobre el grupo femenino surcoreano Blackpink, que recopila imágenes inéditas de los cinco años desde el debut de las miembros del grupo, Jisoo, Jennie, Rosé y Lisa; y entrevistas especiales.', 2021, 3, '619d18892f156.jpg', 25),
	(87, 'What Drives Us', 88, 'Dave Grohl', 'Documental', 'Dirigida por Dave Grohl, este largometraje documental es una carta de amor al raro club del rock and roll, así como una inspiración para todos los niños pequeños que sueñan con una vida tocando música. Dave era ese niño. Y también Ringo, Annie Clark, The Edge, Steven Tyler y todos los demás. La lista es infinita. Si bien todos tienen historias, escandalosas, increíbles, locas y conmovedoras, todos comparten un vínculo común. En algún momento, antes de que nadie supiera su nombre, tuvieron un impulso imparable por compartir su música con el mundo. Su pasión los llevó a dejar todo atrás, lanzar la precaución al viento y perseguir su sueño. A nadie se le prometió nada, pero todos tenían un plan.', 2021, 4, '619d18c6b0aac.jpg', 25),
	(88, 'Becoming Led Zeppelin', 137, 'Bernard MacMahon', 'Documental', 'El proyecto, que se anunció primero en 2019, tiene un acceso sin precedentes a la banda, marcando la primera y única vez que el grupo ha participado en un documental en 50 años. Aunque el documental de 1976 \'The Song Remains The Same\' se centra en la banda, aquello fue en gran parte una película de concierto de una serie de actuaciones en el Madison Square Garden en 1973. (FILMAFFINITY)', 2021, 5, '619d19158f35e.jpg', 25),
	(89, 'I Feel Good: La historia de James Brown', 138, 'Tate Taylor', 'Documental', 'Basada en la extraordinaria trayectoria del padrino del soul, la película se adentra sin temor en la música, la vida y los estados de ánimo de James Brown, guiando al público en un viaje desde la dura infancia del cantante hasta que se convierte en una de las figuras más influyentes del siglo XX. (FILMAFFINITY)', 2014, 5, '619d19729691b.jpg', 25),
	(90, 'Searching for Sugar Man', 87, 'Malik Bendjelloul', 'Documental', 'A finales de los años 60, Sixto Rodríguez, un misterioso músico, fue descubierto en un bar de Detroit por dos productores que quedaron fascinados por sus melodías conmovedoras y sus letras proféticas. Grabaron dos discos con la convicción de que el artista se convertiría en uno de los más grandes de su generación. Sin embargo, el éxito nunca llegó, y el cantante desapareció en medio de rumores sobre su suicidio en un escenario. Mientras tanto, uno de los discos llegó a la Sudáfrica del Apartheid y se extendió por todo el país en grabaciones piratas, que hizo de Rodríguez un icono de la libertad y de la lucha contra el sistema. Mucho tiempo después, dos fans sudafricanos se empeñaron en averiguar qué había pasado realmente con Rodríguez y su investigación los llevó a conocer una historia extraordinaria. (FILMAFFINITY)', 2012, 5, '619d1a4713605.jpg', 25);
